import { useContext } from "react";
import { Link } from "react-router-dom";
import AuthContext from "../context";
const Navbar = () => {
  const { token } = useContext(AuthContext);

  return (
    <div
      className="relative flex items-center cursor-pointer my-auto sm: w-10/12 h-24 md:w-30
      md:h-20 lg:w-50 lg:h-20 mr-16"
    >
      <Link to="/">
        <p className="font-bold text-xl">Logo</p>
        <img src={"/ICON-Student-2.png"} alt="" />
      </Link>
      {token ? (
        <p className="font-bold text-xl">Welcome</p>
      ) : (
        <Link to="/register">
          <p className="font-bold text-xl">Register</p>
        </Link>
      )}
    </div>
  );
};

export default Navbar;

